import React from 'react';

const mystyle = {
	color: 'white',
	fontSize: '40px',
	fontFamily: 'serif',
	textAlign: 'center',
	padding: '100px',
	textShadow: '7px 2px black',
	marginTop: '100px',
	height: '100%',
	width: '100%',
	backgroundSize: 'cover',
};

const Contact = () => {
	return (
		<div style={mystyle}>
			<h1>Contact Information</h1> <br />
			<h2>Please reach us @www.burgernbite.com</h2>
			<h3>Contact us with: 000123456</h3>
		</div>
	);
};

export default Contact;
